import "./App.css";
import {Route, BrowserRouter as Router} from "react-router-dom";
import Sol from "./pages/sol";
import Eth from "./pages/sol";
import Land from "./pages/sol";

const App = () => {

  return (
    <Router>
    <Route path="/" exact component={Sol} />
    <Route path="/SOL" exact component={Sol} />
    <Route path="/ETH" exact component={Sol} />
  </Router>
  );
};

export default App;
